import React from "react";
import { Link, Navigate } from "react-router-dom";
import { useParams } from "react-router-dom";
import { subcategoriesMap } from "./miniDatabase"; // Named import

export default function Subcategories() {
  const params = useParams();
  const categoryId = params.categoryId;
  const subcategories = subcategoriesMap[categoryId];

  useEffect(() => {
    if (!subcategories) {
      navigate("/pagenotfound");
    }
  }, [subcategories, navigate]);

  return (
    <div className="subcategories">
      <Link to="/search/category">
        <i class="fa-solid fa-angle-left"></i>
      </Link>
      <h2>Choose Category</h2>
      <div className="subcategory-name">
        <p>{params.categoryId}</p>
      </div>
      <h3>Subcategories</h3>
      {subcategories.map((subcategory, index) => (
        <div key={index} className="subcategory">
          <p>{subcategory}</p>
        </div>
      ))}
    </div>
  );
}
